import { getData } from "../utils/getData";
import { Link } from "react-router-dom";
import AnalysisWeek from "./AnalysisWeek";
import { OneDate } from "../type";

function Dashboard() {
  useEffect(() => {
    getData(setData);
  }, []);
  return (
    <>
      <Header />
      <TimeInput />
      <Contribution />
      <div>
        <Link to="/analysis-week">
